                </div>


            <div className='center flex mt6'>
                <div  className='center mb3 pr4' >
                    <Button text = {gretting}  estilo = {estiloButton} onSumbitSubscription = {this.onSumbitSubscription} />
                </div>
                <div  className='center mb3 pl4' >
                    <Button text = {gretting}  estilo = {estiloButton} onSumbitSubscription = {this.onSumbitSubscription} />
                </div>    
            </div>


            </div>
        </div>
    );

    }
    }

    export default BodyCard;
